// src/components/HomePage.js

import React from 'react';

const HomePage = () => {
  return (
    <div>
      <center>
        <p>
          Portfolionaire, our dedicated resume website, is a dynamic tool catering specifically to the students of our class. 
          This platform provides a centralized space for showcasing a comprehensive overview of skills, experiences, achievements, etc., 
          empowering individuals to highlight their unique qualities. Its interactive features ensure a captivating user experience, 
          fostering deeper engagement. Furthermore, Portfolionaire significantly boosts online visibility, optimizing searchability 
          and discoverability in the digital realm. In essence, this platform stands as a strategic asset, delivering a modern, 
          tailored, and impactful representation of each student's professional identity, ultimately enhancing their prospects in the 
          competitive academic and professional landscape.
        </p>
      </center>
    </div>
  );
}

export default HomePage;
